  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains lidar point data
  (Geodetic Coordinates) from a strip of Southern California coastline (including
  water, beach, cliffs, and top of cliffs) from Dana Point to La Jolla. The data set
  was created by combining data collected using an Optech Inc. Airborne Laser Terrain
  Mapper (ALTM) 1225 in combination with geodetic quality Global Positioning System
  (GPS) airborne and ground-based receivers. The Bureau of Economic Geology, the University
  of Texas at Austin owns and operates an ALTM 1225 system (serial number 99d118).
  The system was installed in a twin engine Partenavia P-68 (tail number N3832K) owned
  and operated by Aspen Helicopter, Inc. The lidar data set described by this document
  was collected on 2 April 2004 between 19:14 and 21:20 UTC. Julian Day 09304 (see
  Lineage, Source_Information, Source_Contribution for pass information). Conditions
  on 4 April were low clouds at 2500-3000 ft and lower over La Jolla. 99d118 instrument
  settings for these flights were; laser pulse rate: 25kHz, scanner rate: 26Hz, scan
  angle: +/- 20deg, beam divergence: narrow, altitude: 300-600m AGL, and ground speed:
  95-120kts. Two GPS base stations were operating during each day of the survey, Point
  Loma and San Onofre on 08306 and Seal Beach and San Onofre on 08406 (see Lineage,
  Source_Information, Source_Contribution for coordinates). Data represented is all
  points including terrain, vegetation, and structures. This data also contains returns
  from the water surface. No processing has been done to remove returns from terrain,
  vegetation, structures or water surfaces.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
